Creating unique Indexes with MongoDb default driver in Go<p>I'm having some issues creating unique indexes for some of my data using the <a href="https://github.com/mongodb/mongo-go-driver" rel="noreferrer">official MongoDB driver for Go</a>.</p>

<p>So I have a struct like this: </p>

<pre><code>type Product struct {
    ID        primitive.ObjectID `json:"_id" bson:"_id"`
    Name      string             `json:"name" bson:"name"`
    Price     float64            `json:"price" bson:"price"`
    Attribute []Attribute        `json:"attribute" bson:"attribute"`
    Category  string             `json:"category" bson:"category"`
}
</code></pre>

<p>And then I wan to create a unique index for the <code>name</code> property. I tried to do something like this in my <code>Create</code>function (for products)</p>

<pre><code>func Create(c echo.Context) error {

    //unique index here 
    indexModel, err := productCollection.Indexes().CreateOne(context.Background(),
        IndexModel{
            Keys:    bsonx.Doc{{"name", bsonx.Int32(1)}},
            Options: options.Index().SetUnique(true),
        })
    if err != nil {
        log.Fatalf("something went wrong: %+v", err)
    }

    //create the product here
    p := new(Product)
    if err := c.Bind(p); err != nil {
        log.Fatalf("Could not bind request to struct: %+v", err)
        return util.SendError(c, "500", "something went wrong", "failed")
    }
    ctx, cancel := context.WithTimeout(context.Background(), 10*time.Second)
    defer cancel()
    result, _ := productCollection.InsertOne(ctx, p)

    return util.SendSuccess(c, result.InsertedID)

}
</code></pre>

<p>The problem is I don't exactly know how to pass <code>indexModel</code> as an option in the context before creating the product. Also, I'm not sure that with what I'm doing, I'm creating the index <strong>just once (which is what I want to do)</strong>. I'd appreciate it if I could be pointed in the right direction on how to do this.</p>

<p>I'm using the echo framework for Go, just in case this provides more context.  </p>

