MongoDB - Comment Upvoting/Downvoting with Aggregation Pipeline<p>I'm trying to implement an upvote/downvote mechanism for comments (similar to the upvoting/downvoting mechanism found on reddit). I have a separate collection called <code>commentReputation</code> and the documents inside can look like this:</p>

<pre><code>{
    "_id" : ObjectId("5e5acb6d6034a879655c8819"),
    "commentId" : ObjectId("5e5983102328a83d1a4b541f"),
    "creationDate" : ISODate("2020-02-29T20:37:01.509Z"),
    "upvotes" : [
        ObjectId("5e5983102328a83d1a4b53e7"),
        ObjectId("5e5983102328a83d1a4b53e4")
    ],
    "downvotes" : [
       ObjectId("5e5983102328a83d1a4b53e5")
    ]
}
</code></pre>

<p>In short: every comment will eventually have it's own <code>CommentReputation</code> document (the <code>CommentReputation</code> document should be created as soon as someone upvotes/downvotes a comment)</p>

<p>There are 2 case scenarios:</p>

<ol>
<li><p>The collection is empty meaning that I need to create my very first <code>CommentReputation</code> document with a given commentId <code>x</code>. In some other part of the project I was using <code>$setOnInsert</code> with <code>{ upsert: true }</code> but it seems (looking at the documentation) that the aggregation pipeline does not support <code>$setOnInsert</code> as for now. Is there another way to deal with this problem?</p></li>
<li><p>The document is there and the actuall upvoting should occur.</p>

<p>a) Both <code>upvotes</code> and <code>downvotes</code> arrays do not contain the <code>userId</code> that is trying to upvote thus it gets added to the <code>upvotes</code> array without any further actions</p>

<p>b) The <code>upvotes</code> array contains the <code>userId</code> that is trying to upvote the comment as a result the <code>userId</code> should be REMOVED from the <code>upvotes</code> array. (the user already had this comment upvoted and clicked a second time the upvote button which cancels out the upvote)</p>

<p>c) The <code>downvotes</code> array contains the <code>userId</code>. In this case the <code>userId</code> should be removed from <code>downvotes</code> and added to <code>upvotes</code></p></li>
</ol>

<p>I'm trying to accomplish the above logic with the <code>updateOne</code> method and a aggreagtion pipeline however I'm not sure if this is even possible. </p>

<p>What I currently have is returning a <code>"Unrecognized pipeline stage name: '$cond'"</code></p>

<pre><code>const updateUpvotes = {
  $cond: {
    if: { $elemMatch: { upvotes: ObjectID(userId) } },
    then: { $pull: { upvotes: ObjectID(userId) } },
    else: { $addToSet: { upvotes: ObjectID(userId) } }
  }
};

db.collection(collectionName).updateOne({
   commentId: ObjectID('5e5983102328a83d1a4b541f')
}, [updateUpvotes])
</code></pre>

<p>Am I overthinking the whole feature? I guess the <code>1.</code> problem can be solved by simply creating a <code>CommentReputation</code> document (with empty <code>upvotes</code> and <code>downvotes</code> at the same time the <code>Comment</code> document is being created. </p>

<p>Is there a better way of doing this? I would love to have it working inside a single query request. Maybe someone of You guys implemented a similar feature and can give me some hints on this one.</p>

