<pre><code>[
    {
        "_id": "1",
        "name": "X",
        "age": "2",
        "createdAt": "2020-02-29T22:22:49.491Z",
        "updatedAt": "2020-02-29T22:22:49.491Z",
        "__v": 0
    },
    {
        "_id": "2",
        "name": "A",
        "age": "3",
        "createdAt": "2020-02-28T22:22:49.491Z",
        "updatedAt": "2020-02-28T22:22:49.491Z",
        "__v": 0
    },
    {
        "_id": "3",
        "name": "B",
        "age": "2",
        "createdAt": "2020-02-29T12:22:49.491Z",
        "updatedAt": "2020-02-29T12:22:49.491Z",
        "__v": 0
    }
]
</code></pre>

<p>As you see, 2 objects have same <code>age</code> as 2 and 1 have <code>age</code> as 3. I want to query from node.js by <code>age</code>, so that when I query by <code>age</code> 2, I get an array with objects having <code>age</code> 2. Currently <code>findById</code> works for me with query as <code>id</code>.</p>

<p>Here is the code:</p>

<pre><code>exports.findByAge = (req, res) =&gt; {
    Property.findById(req.params.propertyId)
        .then(property =&gt; {
            if (!property) {
                return res.status(404).send({
                    message: "Not found " + req.params.propertyId
                });
            }
            res.send(property);
        }).catch(err =&gt; {
            if (err.kind === 'ObjectId') {
                return res.status(404).send({
                    message: "Not found with id " + req.params.propertyId
                });
            }
            return res.status(500).send({
                message: "Error retrieving property with id " + req.params.propertyId
            });
        });
};
</code></pre>

<p>How do I query by <code>age</code>?</p>

